package lo.java.container;

public class Ptest {
	public static String re = "";
	public static void getRe(){
		int i = 1;
		
		while(i>0){
			String temp = re;
			re = re + "0";
			char[] t = temp.toCharArray();
			for(int j=0;j<temp.toCharArray().length;j++){
				t[j] = (char) ('1' - t[j] + '0');
			}
			for(int j=0;j<=temp.toCharArray().length/2-1;j++){
				t[j] = (char) (t[j]^t[temp.toCharArray().length-j-1]);
				t[temp.toCharArray().length-j-1] = (char) (t[j]^t[temp.toCharArray().length-j-1]);
				t[j] = (char) (t[j]^t[temp.toCharArray().length-j-1]);
			}
			re = re + String.valueOf(t);
			i--;
		}
		System.out.println(re);
	}
	
	
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=0;i<re.toCharArray().length;i++ ){
			if(Test.solve(i)!=(re.charAt(i)-'0')){
				System.out.println(i+"  "+Test.solve(i));
			}else{
				System.out.println(i+"is right  ");
			}
		}
//		getRe();
	}

}
